import React from "react";

const HighScore = (props) => {
  return (
    <div>
      <h1>High Score per Country</h1>
      {props.scores.map((x, index) => (
        <div key={index}>
          <p>High Scores:{x.name}</p>
          {/* <p>{console.log(x.scores)}</p> */}
          <p>
            {x.scores.map((x , index) => (
              <p key>{x.n}</p>
            ))}
          </p>
        </div>
      ))}
    </div>
  );
};

export default HighScore;
